import React from "react";

import Navbar from "../../components/Navbar/Navbar.jsx";
import Footer from "../../components/Footer/Footer.jsx";
import Loading from "../../components/Loading/Loading.jsx";
import Error from "../../components/Errors/Error.jsx";

import AboutTop from "./Sections/About/AboutTop.jsx";
import Carousel from "./Sections/Carousel/Carousel.jsx";

import "./about.styles.css";

export default function About() {
  return (
    <>
      <Navbar />
      <main className="">
        <AboutTop />

        <Carousel />

        <section className="socios mx-w">
          <div className="bg-title-t1"></div>
          <div className="title-t1">
            <h2>Socios Activos</h2>
            <p>
              Conoce nuestra lista de socios activos, que juegan un papel
              importante dentro de nuestro trabajo.
            </p>
          </div>

          <div className="wrapper-logos">Logos...</div>
        </section>
      </main>
      <Footer />
    </>
  );
}
